import CityListItem from "../../components/ShowCity/CityListItem";
import HotelListItem from "../../components/ShowTypeHotel/TypeHotelListItem";
import Layout from "../../layout/Layout";
import { styled } from "styled-components";

const Div = styled.div`
  padding: 70px 300px;
`;

const Home = () => {
  return (
    <Layout>
      <Div>
        <CityListItem />
        <HotelListItem />
      </Div>
    </Layout>
  );
};

export default Home;
